  false,\n\t\"url\": null,\n\t\"notes\": \"Critical environmental features (CEFs)
  are defined in the City of Austin Land Development Code 25-8-1. This dataset represents
  wetland CEFs identified during the development review process since 1995. Prior
  to 1995, data is either unavailable or lost.Wetland CEFs were digitized from construction
  plans, environmental assessments, and City of Austin staff field observations. Features
  were digitized into a versioned SDE database in ArcMap. Wetland delineation may
  be determined through a process of negotiation with land development interests and
  generally reflect the most protective arrangement that could be obtained. Additionally,
  u201cfringe wetlandsu201d were drawn using a standard 2u2019 width on either side
  of a waterway.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
